// Enum for EventIdentification
enum class EventIdentification : uint8_t
{
    kEndOfCycle         = 0x01,
    kTemperatureReached = 0x04,
    kEndOfCooking       = 0x05,
    kSwitchingOff       = 0x06,
    kWrongData          = 0x07,
};
